  \"2013-03-16T00:03:53.307711\",\n\t\"name\": \"utah-aqueous-spring-chemistry\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of aqueous
  chemistry data from thermal springs in Utah, submitted by the Utah Geological Survey
  and published as a downloadable file, ESRI Service, and as a Web Feature service
  for the National Geothermal Data System by the AZGS.  The document contains 12 worksheets,
  including information about the template, instructions for using the template, notes
  related to revisions of the template, Resource provider information, the data, a
  field list (data mapping view) and a worksheet with vocabularies for use in populating
  the spreadsheet (data valid terms). Data from 285 analysis are included. Fields
  in the data table include AnalysisURI, AnalysisName, Notes, SamplingFeatureName,
  SamplingFeatureURI, OtherSiteID, SpecimenID, Label, SpecimenDescription, SpecimenURI,
  SpecimenCollectionDate, SpecimenCollectionMethod, OtherAnalyticalData, FluidTemperature_C,
  Discharge, DischargeUnits, County, State, LatDegree, LongDegree, SRS, LocationUncertaintyStatement,
  PLSSMeridians, Township, Range, Section_, SectionPart, Elevation, ElevationDatum,
  ElevationUnits, Source, MetadataURI, AnalysisType, AnalysisDate, Laboratory, ProcedureSummary
  and DataEntrySource.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
